import React, {useState, useEffect, useRef, memo, useCallback} from 'react';
import { StyleSheet, Animated, Image, Slider, Text, View, TouchableWithoutFeedback, TouchableHighlight, TouchableOpacity, SnapshotViewIOS} from 'react-native';
import {Dimensions, Platform, AsyncStorage} from "react-native";
import {isTablet} from 'react-native-device-detection';
import { Icon } from 'react-native-elements';


import * as media from '../utility/manipulator';
import { ScrollView } from 'react-native-gesture-handler';

var screen = Dimensions.get("window");
const screenW = screen.width;
const screenH = screen.height;
const padding = 15;

const selectImage=(img_src,setImage)=>{
    setImage(img_src);
}

export const StickerView = memo(({setImage,usingSticker})=>{
    const stickers = [
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
        {'uri':"data:image/png;base64,"},
    ]
    return (
        <View style={styles.stickerView}>
            <ScrollView>
                <View style={styles.stickerList}>
                    {
                        stickers.map(function(value,index){
                            return(
                                <TouchableOpacity key={index} style={styles.imageBtn} onPress={()=>{selectImage(value,setImage)}}>
                                    <Image style={styles.image} source={value} />
                                    <View style={[styles.usingIcon,(usingSticker.uri==value.uri)?{}:{display:"none"}]}>
                                        <Icon name='check-circle-o' type='font-awesome' size={22} color="#d4eddb"/>
                                    </View>
                                </TouchableOpacity>
                            )
                        })
                    }
                </View>
            </ScrollView>
        </View>
    ); 
});
const styles = StyleSheet.create({
    stickerView:{
        maxHeight:screenH-280,
    },
    stickerList:{
        flex:1,
        flexDirection:"row",
        flexWrap:"wrap",
        justifyContent:"space-around",
    },
    imageBtn:{
        width:100,
        height:100,
        marginBottom:8,
        position:"relative",
    },
    image:{
        flex:1,
        aspectRatio: 1,
        borderWidth:1,
        borderColor:"#e2e2e2",
    },
    usingIcon:{
        position:"absolute",
        top:0,
        right:0,
        padding:3,
    }
});